@Override
public boolean removeAll(myCollection c) {
    Node<E> point = head;
    myLinkedList templist = new myLinkedList();
    templist=c.myclone();
    int Count=0;
    Node<E> point2 = templist.head;
    for (int i = 0; i < size(); i++) {
        for (int ii = 0; ii < c.size(); ii++) {
            if (point.data == point2.data) {
            remove(i);
            nodeCount++;
            Count++;
            }
            point2=point2.nextNode;
        }
        point2=templist.head;
        point = point.nextNode;
    }
nodeCount=nodeCount-Count;
return true;
}
